import React, {useEffect, useState} from "react";
import {useParams} from "react-router-dom";
import axios from "../../custom-axios/axios"

const UserQuestion = () =>{
    const[messages,setMessages] = useState({
        messageArr : []
    });
    const{userID} = useParams();
    useEffect(()=>{
        axios.get("/user/post/receiver/" + userID).then((data)=>{
            setMessages({
                messageArr : data.data
            })
        })
    },[]);
    console.log("Messages of the user->",messages.messageArr)
    return(
        <div>
            <span className="font-400">Languages: </span>
            <span className="profile-right">
                                        <ul>
                                    {messages.messageArr && messages.messageArr.map((item, key) => {
                                        console.log(item)
                                        // return <li>{item.name}</li>
                                    })}
                                        </ul>
                                    </span>
        </div>
    )

};

export default UserQuestion;
